    console.log(roundDrinkers);

    return (
      <div>
        <h3>${round.price}</h3>

        <button onClick={onDeleteRound} value={round.id}>
          Delete
        </button>
      </div>
    );
  });

  return <div>{roundsButton}</div>;
}
export default RoundsPurchased;
